import React, { Component } from "react";
import "./header.css";

class Buttons extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <React.Fragment>
        <h1>Visual Pathfinder</h1>
        <ul className="button-container">
          <button
            className={this.props.getBtnClass("start")}
            onClick={this.props.handleStartClick}
            onMouseEnter={this.props.handleStartHover}
            onMouseLeave={this.props.handleStartHover}
          >
            Start
          </button>
          <button
            className={this.props.getBtnClass("end")}
            onClick={this.props.handleEndClick}
            onMouseEnter={this.props.handleEndHover}
            onMouseLeave={this.props.handleEndHover}
          >
            End
          </button>
          <button
            className={this.props.getBtnClass("wall")}
            onClick={this.props.handleWallClick}
            onMouseEnter={this.props.handleWallHover}
            onMouseLeave={this.props.handleWallHover}
          >
            Wall
          </button>
          <button
            className={this.props.getBtnClass("reset")}
            onClick={this.props.handleResetClick}
            onMouseEnter={this.props.handleResetHover}
            onMouseLeave={this.props.handleResetHover}
          >
            Clear Grid
          </button>
          <button
            className={this.props.getBtnClass("go")}
            onClick={this.props.handleGoClick}
            onMouseEnter={this.props.handleGoHover}
            onMouseLeave={this.props.handleGoHover}
          >
            Go
          </button>
        </ul>
      </React.Fragment>
    );
  }
}
